function Prompt() {
  return (
    <div className="rounded-lg bg-[#F3F4F6] w-200 py-6 mb-15 text-[#4D6BFE]">
      <form action="" method="post">
        <input
          type="text"
          name="user_prompt"
          id="user_prompt"
          placeholder="Ask anything"
          className="size-100"
        />
        <button type="submit" disabled className="bg-red-100 rounded-full p-5">
          Send
        </button>
      </form>
    </div>
  );
}

export default Prompt;
